import { Fragment, useEffect, useState } from "react";
import classes from "./FetchData.module.css";

const FetchData = () => {
  const [isData, setIsData] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((respose) => {
        return respose.json();
      })
      .then((data) => {
        setIsData(data);
      });
  }, []);

  return (
    <Fragment>
      <section className={classes.section}>
        <input type="text" placeholder="Search" className={classes.input} />
      </section>
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Username</th>
              <th>Email</th>
              <th>Mobile</th>
            </tr>
          </thead>
          {isData.map((item) => {
            <tbody>
              <tr>
                <td>{item.name}</td>
                <td>{item.username}</td>
                <td>{item.email}</td>
                <td>{item.phone}</td>
              </tr>
            </tbody>;
          })}
        </table>
    </Fragment>
  );
};
export default FetchData;
